import React from "react";
import {Container,Navbar,NavDropdown,Nav, Col,Row, Button, OffcanvasBody} from "react-bootstrap"
import logo from './logo.png'
import { useState } from "react";
import Offcanvas from 'react-bootstrap/Offcanvas';
function Home1(){

  const [show, setShow] = useState(false);
const showDropdown = (e)=>{
    setShow(!show);
}
const hideDropdown = e => {
    setShow(false);
}
    return(
        <div>
<Container fluid className=" black1">
<Container className=" text-white ps-0 pt-2 pb-2 w-75 black " >
    <span>Free shipping, 30-day return or refund guarantee.</span> 
    <span style={{float :'right'}}>
<ul className="text-end fs-6">
    <li>SIGN IN</li>
    <li>FAQs</li>
    <li>USD</li>
</ul>
   </span>
</Container>
</Container>
<Container fluid>
    <Container  className="nb ps-0 pe-0 w-75 navbar">     
    {['xxl' ].map((expand) => (  
<Navbar  key={expand} className="w-100" expand="expand">
        <Navbar.Brand ><img src={logo}/></Navbar.Brand>
         <Navbar.Toggle aria-controls={`offcanvasNavbar-expand-${expand}`} />
         <Navbar.Offcanvas
              id={`offcanvasNavbar-expand-${expand}`}
              aria-labelledby={`offcanvasNavbarLabel-expand-${expand}`}
              placement="start"
            >
         <Offcanvas.Header closeButton>
                <Offcanvas.Title id={`offcanvasNavbarLabel-expand-${expand}`}>
                  Offcanvas
                </Offcanvas.Title>
              </Offcanvas.Header>
              <Offcanvas.Body>
          <Nav className="m-auto ">
            <Nav.Link >Home</Nav.Link>
            <Nav.Link >Shop</Nav.Link>
            <NavDropdown className="dd" title="Pages" show={show}
   onMouseEnter={showDropdown} 
   onMouseLeave={hideDropdown}  id={`offcanvasNavbarDropdown-expand-${expand}`} >
              <NavDropdown.Item className="dl" href="#action/3.1">About Us</NavDropdown.Item>
              <NavDropdown.Item className="dl" href="#action/3.2">
                Shopping details
              </NavDropdown.Item>
              <NavDropdown.Item className="dl" href="#action/3.3">Shopping Cart</NavDropdown.Item>
              <NavDropdown.Item className="dl" href="#action/3.4">Check Out</NavDropdown.Item>
              <NavDropdown.Item className="dl" href="#action/3.5">Blog Details</NavDropdown.Item>
            </NavDropdown> 
            <Nav.Link >Blog</Nav.Link>
            <Nav.Link >Contacts</Nav.Link>            
    </Nav>
      <Nav className="ms-auto">
            <Button >search</Button>
            </Nav>
    </Offcanvas.Body>   
</Navbar.Offcanvas>
    </Navbar>
       ))}
    </Container>
    </Container>
    </div>
    );
};

export default Home1;
